import React from 'react'

const Service = ({service: {name, content, icon}}) => {
  return (
    <div className='service text-center'>
      <span className={`md1 ${icon} icon-simple`}></span>
      <h4 className='my-4'></h4>
    </div>
  )
}

export default Service;
